import React, { useState, useEffect } from 'react';

import { Stepper, Step, StepLabel } from '@mui/material';
import AnswersContainer from '../../shared/ui/answersContainer';

import FormControlAnswers from '../../shared/ui/formControlAnswers';

import { array, IQuestion } from '../../consts';
import { getValue } from '@testing-library/user-event/dist/utils';

const Home = () => {
  const [step, setStep] = useState<number>(0);
  const [answers, setAnswers] = useState(array[0]);
  // const { register } = useForm();
  // const steps = ['Select campaign settings', 'Create an ad group', 'Create an ad'];

  const handleChangeStep = (index: number) => {
    setStep(index);
    setAnswers(array[index]);
  };

  console.log('==========>steo', step);
  return (
    <div>
      <Stepper activeStep={step}>
        {array.map((label: IQuestion, index: number) => {
          return (
            // eslint-disable-next-line react/no-array-index-key
            <Step onClick={() => handleChangeStep(index)} key={index.toString(36)}>
              <StepLabel>{label.questionName}</StepLabel>
            </Step>
          );
        })}
      </Stepper>
      <div>
        {answers.answers.map((value, index) => {
          return <AnswersContainer 
          questionName={answers.questionName} 
          questionQuest={answers.questionQuest} 
          isTrue={value.isTrue} 
            name={value.name}/>;
        })}
      </div>
    </div>
  );
};

export default Home;
